import React from 'react';
import Resume from '../img/Resume.PNG';
import '../../styles/Contact.css';

export default function Contact() {
  return (
    <div id="Resume">
      <h1>Resume</h1>
      <div id="education">
        <h2>Education</h2>
        <ul>
          <li>
            <h4></h4>
          </li>
        </ul>
      </div>
      <div id="Skills">
        <h22>Skills</h22>
          <ul>
            <li></li>
          </ul>
      </div>
      <a href={Resume} download>Click to download</a>
    </div>
  );
}
